import * as React from 'react';

import '../App.css';
import logo from '../assets/logo.png';

function LeftNav() {

    return <>
      <nav className="left sideNav d-flex flex-column">
        <div style={{display:'inline-flex'}}><img src={logo} style = {{height:'50px', width: '50px' , margin:'15px', top:'0px', left:'0px'}} alt=""></img> </div>
          <ul>
              <li>menu</li>
              <li>Setting</li>
              <li>test</li>
              <li>profile</li>
          </ul>
      </nav>
    </>

}
export default LeftNav;
